import React from 'react'
import {Link} from "react-router-dom";

function NavBar() {
    return (
        <nav className="nav">
            <ul>
                <Link to="/">Home</Link>
                <Link to="/manage-items">Manage Posts</Link>
                <Link to="/create-item">Create a new post</Link>
            </ul>
        </nav>
    )
}

export default NavBar
